css:
.github-StagingView {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-group {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-header {
  display: flex;
  align-items: center;
  padding: 0 0 0 2px;
  font-weight: 600;
  border-top: 1px solid rgba(0, 0, 0, 0.6);
  border-bottom: 1px solid rgba(0, 0, 0, 0.6);
}
.github-StagingView-group:first-child .github-StagingView-header {
  border-top: none;
}
.github-StagingView-header .icon {
  text-align: center;
}
.github-StagingView-header .icon:before {
  color: rgba(237, 237, 237, 0.2);
  margin-right: 1.66666667px;
  vertical-align: middle;
}
.github-StagingView-headerButton {
  height: 2.5em;
  border: none;
  padding: 0 2px;
  font-weight: normal;
  border-left: 1px solid rgba(0, 0, 0, 0.6);
  white-space: nowrap;
  background: none;
  cursor: default;
}
.github-StagingView-headerButton:disabled {
  color: rgba(237, 237, 237, 0.2);
}
.github-StagingView-headerButton:active {
  background-color: rgba(13, 13, 13, 0);
}
.github-StagingView-headerButton.icon:before {
  margin-right: 0;
  font-size: 1em;
  text-align: left;
}
.github-StagingView-headerButton--fullWidth {
  border-left: none;
  border-bottom: 1px solid rgba(0, 0, 0, 0.6);
}
.github-StagingView-title {
  flex: 1;
  margin-right: 2px;
  line-height: 2.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.github-StagingView-list {
  flex: 1 1 0;
  overflow-x: auto;
}
.github-StagingView-group-truncatedMsg {
  padding: 1px 2px;
}
.github-StagingView-group.is-focused .is-selected {
  color: #ededed;
  background: #444444;
}
.github-StagingView:focus .github-StagingView-group.is-focused .is-selected {
  color: #ffffff;
  background: rgba(0, 0, 0, 0);
}
